        <>
<div class="container mt-3">
  <h2>{userData.firstname}</h2>
  <br/>
  {/* <img src={userData.name==="jiya"?  userpic:userpic2 }></img> */}
           
  <table class="table table-dark">
   
    <tbody>
      <tr>
        <td>Email</td>
        {/* <td>work</td> */}
        <td>phone</td>
      </tr>
      <tr>
        <td>{ userData.email }</td>
        <td>{ userData.work }</td>
        <td>{ userData.phone }</td>
      </tr>
      
    </tbody>
  </table>
</div>

        </>
    )
}
export default Userprofile;
